import React from 'react';

const storyList = ({ stories }) => (
    <main className="story-list">
        {stories.map(story => (
            <div className="story" key={story.id}>
                <h2 className="story.title"><a href={story.url}></a></h2>
            </div>
        ))}
    </main>
)

export default storyList;
